import React from "react";

function Card(props) {
  return (
    <div id="pokemon-item" onClick={props.onClick}>
      <img src={props.imgUrl} />
      <p> {props.name}</p>
      <p>{`HP: ${props.HP}   ATK: ${props.ATK}`}</p>
    </div>
  );
}
export default Card;
